// RoomBox.jsx

import React from 'react';

const RoomBox = ({ roomNumber, capacity, slotsLeft }) => {
  return (
    <div className="w-20 h-">
      <p>Room Number: {roomNumber}</p>
      <p>Capacity: {capacity}</p>
      <p>Slots Left: {slotsLeft}</p>
    </div>
  );
};

export default RoomBox;
